function Home({ Data, DataUser }) {
  return (
    <>
      <section>
        <header>
          <nav>
            <img src={DataUser[0].img} alt="UserImage" />
            <h3>{DataUser[0].name}</h3>
            <p>Icon</p>
          </nav>
        </header>
      </section>
    </>
  );
}

export default Home;
